import { HttpClient } from '@angular/common/http';
import { Component, OnInit, Input } from '@angular/core';
import { CommonModule } from '@angular/common';
@Component({
  selector: 'app-innermembership1',
  templateUrl: './innermembership1.component.html',
  styleUrls: ['./innermembership1.component.css']
})
export class Innermembership1Component implements OnInit {
  
  url: string = '/assets/static/membership1.json';
  @Input() value: any;
  data:any;
  constructor(private http: HttpClient) { }

  ngOnInit() {
   this.data= this.http.get(this.url);
   console.log('child', this.data);
  }

}
<table class="table text-center">
  <thead>
    <tr>
      <th style="width: 34%">Yearly Access</th>

      <th style="width: 22%">T1 $420</th>

      <th style="width: 22%">T2 $640</th>

      <th style="width: 22%">T3 $860</th>
    </tr>
  </thead>
  <tbody *ngFor="let data of value">
    <tr [class]="data.class">
      <th scope="row" class="text-start" id="Mo">
        {{ data.name }}
      </th>
      <td>
        <i [class]="data.first"></i>
      </td>
      <td>
        <i [class]="data.second"></i>
      </td>
      <td>
        <i [class]="data.third"></i>
      </td>
    </tr>
  </tbody>
</table>
